Максимальная скорость передачи данных
(Код ответа:
1 – ниже 256 Кбит/сек;
2 – 256 Кбит/сек – 1.9 Мбит/сек;
3 – 2 – 9.9 Мбит/сек;
4 – 10– 30.0 Мбит/сек;
5 – 30.1– 100.0 Мбит/сек;
6 – 100.1 – 500 Мбит/с;
7– 500.1 Мбит/с – 1Гбит/с;
8 – выше 1Гбит/с)

Код ответа
(1 – полностью удовлетворены;
2 – частично удовлетворены;
3 – не удовлетворены)

Код ответа
(1 – для основных процессов организации (маркетинга, продаж,
производственных процессов, логистики);
2 – для обеспечивающих процессов (информационная
безопасность, управление кадрами);
3 – для управленческих процессов (организация процессов
делового администрирования, управление организацией);
4 – не используются)

Код ответа
(1 – преимущественно платно;
2 – преимущественно бесплатно;
3 – в равной степени платно и бесплатно;)
